def getNewSearch():
    payload = rawdata_newsearch
    req = requests.Request('POST', "http://unro.minjust.ru/NKOs.aspx", headers=headers, data=payload)
    prepared = req.prepare()
    session = requests.Session()
    try:
        response = session.send(prepared)
        pages_count = 0
        pgs = response.request.body.split("&")
        for pg in pgs:
            if "pdg_pdg_record_count" in pg:
                pages_count = int(pg.split("=")[1])
                break
        return pages_count
    except:
        return None, 0

def getNextPage(startpos):
    payload = setStartPos(startpos)
    req = requests.Request('POST', "http://unro.minjust.ru/NKOs.aspx", headers=headers, data=payload)
    prepared = req.prepare()
    session = requests.Session()
    try:
        response = session.send(prepared)
        return response.content
    except:
        return None

