def getTableHeader(bs):
    try:
        table = bs.find("table", attrs={"id": "pdg"})
        tbl_hdrs = ["id"]
        tbl_hdrs += [urllib.parse.unquote(val.text) for val in table.find_all("td", attrs={"class": "pdg_h"})]
        return tbl_hdrs
    except:
        return None


def getNKOInfo(bs, odd_str):
    info = []
    try:
        info.append(bs.get("id"))
        info.append(bs.find("td", attrs={"class": "pdg_item_left_{}".format(odd_str)}).text)
        vals = bs.find_all("td", attrs={"class": "pdg_item_{}".format(odd_str)})
        vals = [val.text for val in bs.find_all("td", attrs={"class": "pdg_item_{}".format(odd_str)})]
        info += vals
        info.append(bs.find("td", attrs={"class": "pdg_item_right_{}".format(odd_str)}).text.replace("-", ""))
    except:
        print ("    ")
    return info


