bs = BeautifulSoup(content, "lxml")

nko_table = bs.find("table", attrs={"id":"pdg"})
table_header = getTableHeader(bs)

csv.register_dialect('customcsv', delimiter=',', quoting=csv.QUOTE_ALL)
with open("nko_minjust.csv", "w", encoding='utf-8', newline='') as f:
    writer = csv.writer(f, 'customcsv')

    while start_pos < nkos_count:
        evens = nko_table.find_all("tr", attrs={"odd":"_even"})
        odds = nko_table.find_all("tr", attrs={"odd":"_odd"})

        for even, odd in zip(evens, odds):
            nko_info = getNKOInfo(even, "even")
            if nko_info:
                writer.writerow(nko_info)
                # nkos_info.append(nko_info)
            nko_info = getNKOInfo(odd, "odd")
            if nko_info:
                writer.writerow(nko_info)
                # nkos_info.append(nko_info)

        if len(evens) > len(odds):
            nko_info = getNKOInfo(evens[len(evens)-1], "even")
